DECLARE @Id1  -- Int32
SET     @Id1 = 1

SELECT
	[lw_DetailClass].[Key_1],
	[lw_DetailClass].[DetailId],
	[detail_1].[SubDetailId],
	[detail_1].[DetailId],
	[detail_1].[SubDetailValue]
FROM
	(
		SELECT DISTINCT
			[detail].[DetailId],
			[lw_MasterClass].[Id1] as [Key_1]
		FROM
			(
				SELECT DISTINCT
					[m_1].[Id1]
				FROM
					[MasterClass] [m_1]
				WHERE
					[m_1].[Id1] >= @Id1
			) [lw_MasterClass]
				INNER JOIN [DetailClass] [detail] ON [lw_MasterClass].[Id1] = [detail].[MasterId]
	) [lw_DetailClass]
		INNER JOIN [SubDetailClass] [detail_1] ON [lw_DetailClass].[DetailId] = [detail_1].[DetailId]

